15 minutes later Trina is stapled to my floor, the wire pressing her down as hard as I could get it without making her bleed. Her huge tits look like they are going to burst through the wire the whole time. When several candles worth of hot wax is poured all over her, she can&amp;#039;t do anything but scream and cry out. She&amp;#039;s quite literally stuck in place, even tiny movements hurt unbearably.

So fun. To hurt them. It almost makes everything else go away. For a while.

